     * RPC请求，即利用长连通道进行一次请求和响应的动作
     * @param {String} topic 做RPC请求的topic
     * @param {Object} payload topic的消息内容
     * @param {Function} callback RPC的响应报文回调函数
     * @example
     *      channel.request(
     *          '/demo/rpc_topic',
     *          { msg: 'hello' }
